import React from 'react';
import Navbar from './navbar';
import styled from 'styled-components';

const AboutContainer = styled.div`
    height: 100vh;
    background-color: #EFE7E2;
`
const AboutHeadline = styled.div`
    font-family: Ramaraja;
    font-size: 80px;
    padding-left: 100px;
    padding-bottom: 0px
`

const AboutMessage = styled.div`
`

const AboutBody = styled.div`
    padding-left: 100px;
    font-family: Raleway;
    font-size: 16px;
    font-weight: 500;
`

function About (){
    return(
        <AboutContainer>
            <Navbar/>
            <AboutMessage>
                <AboutHeadline>
                    About
                </AboutHeadline>
                <AboutBody>DataStructs is a beautiful, intuitive platform for vizualizing essential data structures and
                    algorithms. </AboutBody>

            </AboutMessage>
        </AboutContainer>
    )
}

export default About;
